function convert_umlauts(str) {

    if (str !== null && str !== "") {
        str.replace("Ä", /&Auml;/g)
            .replace("ä", /&auml;/g)
            .replace("Ö", /&Ouml;/g)
            .replace("ö", /&ouml;/g)
            .replace("Ü", /&Uuml;/g)
            .replace("ü", /&uuml;/g)
            .replace("ß", /&szlig;/g)
    }
    return str;
}